	<script>
var zoomableElement = document.getElementById('top-svg');
var hammertime = new Hammer(zoomableElement);

var currentScale = 1;
var lastScale;
var posX = 0;
var posY = 0;
var lastPosX = 0;
var lastPosY = 0;
var maxPosX = 0;
var maxPosY = 0;

hammertime.get('pinch').set({ enable: true });
hammertime.get('pan').set({ direction: Hammer.DIRECTION_ALL });

hammertime.on('pinch pan', function(event) {
  // Pinch handling
  if (event.type === 'pinchstart') {
    lastScale = currentScale;
  }
  currentScale = Math.max(1, Math.min(lastScale * event.scale, 4));

  // Pan handling
  if (event.type === 'panstart') {
    lastPosX = posX;
    lastPosY = posY;
  }
  posX = Math.min(0, Math.max(lastPosX + event.deltaX / currentScale, maxPosX));
  posY = Math.min(0, Math.max(lastPosY + event.deltaY / currentScale, maxPosY));

  // Apply transformations
  var transform =
    'translate3d(' + posX + 'px,' + posY + 'px, 0) ' +
    'scale(' + currentScale + ', ' + currentScale + ')';
  zoomableElement.style.transform = transform;
